package com.hudini.data;
public class Constraint {
	int str;
	int dex;
	int inteligent;
	public Constraint(int str, int dex, int inteligent) {
		// TODO Auto-generated constructor stub
		this.str = str;
		this.dex = dex;
		this.inteligent = inteligent;
	}
	public int getStr() {
		return str;
	}
	public void setStr(int str) {
		this.str = str;
	}
	public int getDex() {
		return dex;
	}
	public void setDex(int dex) {
		this.dex = dex;
	}
	public int getInteligent() {
		return inteligent;
	}
	public void setInteligent(int inteligent) {
		this.inteligent = inteligent;
	}
	
}
